var canvas, ctx;
var camera, scene, renderer, meshMaterial, mesh, geometry, i, f;
var mouseX = 0, mouseY = 0;
var startTime = new Date().getTime();
var windowHalfX = window.innerWidth / 2;
var windowHalfY = window.innerHeight / 2;

if (window.attachEvent) {
	window.attachEvent('onload', main_init);
} else {
	if (window.onload) {
		var curronload = window.onload;
		var newonload = function() {
			curronload();
			main_init();
		};
		window.onload = newonload;
	} else {
		window.onload = main_init;
	}
}

function main_init() {
	"use strict";
	// creating canvas and context objects
	canvas = document.getElementById('panel');
	var ctx = canvas.getContext('2d');

	// preparing camera
	camera = new THREE.Camera(30, window.innerWidth / window.innerHeight, 1, 5000);
	camera.position.z = 6000;

	// preparing scene
	scene = new THREE.Scene();

	// preparing geometry
	geometry = new THREE.Geometry();

	// loading texture
	var texture = THREE.ImageUtils.loadTexture('img/clouds.png');
	texture.magFilter = THREE.LinearMipMapLinearFilter;
	texture.minFilter = THREE.LinearMipMapLinearFilter;

	// preparing fog
	var fog = new THREE.Fog(0x251d32, -100, 5000);

	// preparing material
	meshMaterial = new THREE.MeshShaderMaterial({
		uniforms : {
			'map' : {
				type : 't',
				value : 2,
				texture : texture
			},
			'fogColor' : {
				type : 'c',
				value : fog.color
			},
			'fogNear' : {
				type : 'f',
				value : fog.near
			},
			'fogFar' : {
				type : 'f',
				value : fog.far
			},

		},
		vertexShader : document.getElementById('vs').textContent,
		fragmentShader : document.getElementById('fs').textContent,
		depthTest : false
	});

	// preparing planeMesh
	var planeMesh = new THREE.Mesh(new THREE.PlaneGeometry(64, 64));
	for ( i = 0; i < 10000; i++) {
		planeMesh.position.x = Math.random() * 1000 - 500;
		planeMesh.position.y = -Math.random() * Math.random() * 200 - 15;
		planeMesh.position.z = i;
		planeMesh.rotation.z = Math.random() * Math.PI;
		planeMesh.scale.x = planeMesh.scale.y = Math.random() * Math.random() * 1.5 + 0.5;

		THREE.GeometryUtils.merge(geometry, planeMesh);
	}

	mesh = new THREE.Mesh(geometry, meshMaterial);
	scene.addObject(mesh);

	mesh = new THREE.Mesh(geometry, meshMaterial);
	mesh.position.z = -10000;
	scene.addObject(mesh);

	// preparing new renderer and drawing it
	renderer = new THREE.WebGLRenderer({
		antialias : false
	});
	renderer.setSize(window.innerWidth, window.innerHeight);
	document.body.appendChild(renderer.domElement);

	// change positions by mouse
	// document.addEventListener('mousemove', onMousemove, false);

	// change canvas size on resize
	window.addEventListener('resize', onResize, false);

	setInterval(drawScene, 30);
	// loop drawScene
}

function onMousemove(event) {
	"use strict";
	mouseX = (event.clientX - windowHalfX) * 0.3;
	mouseY = (event.clientY - windowHalfY) * 0.2;
}

function onResize(event) {
	"use strict";
	camera.aspect = window.innerWidth / window.innerHeight;
	camera.updateProjectionMatrix();
	renderer.setSize(window.innerWidth, window.innerHeight);
}

function drawScene() {
	"use strict";
	position = ((new Date().getTime() - startTime) * 0.1) % 10000;

	camera.position.x += mouseX * 0.01;
	camera.position.y += -mouseY * 0.01;
	camera.position.z = -position + 10000;

	renderer.render(scene, camera);
}

;
/*
  * @package Dart
  * @subpackage Dart HTML
  * 
  * Template Scripts
  * Created by Tripples
  
  1. Fixed header
  2. Site search
  3. Main slideshow
  4. Owl Carousel
      a. Testimonial
      b. Clients
      c. Team
  5. Back to top
  6. Skills
  7. BX slider
      a. Blog Slider
      b. Portfolio item slider
  8. Isotope
  9. Animation (wow)
  10. Flickr
  
*/



jQuery(function($) {
  "use strict";


  /* ----------------------------------------------------------- */
  /*  Fixed header
  /* ----------------------------------------------------------- */

  function fixedHeader()
  {
    var windowWidth = $(window).width();

    if(windowWidth > 120 ){
      $(window).on('scroll', function(){
        if( $(window).scrollTop()>100 ){
          $('.main-nav').addClass('header-fixed animated slideInDown');
        } else {
          $('.main-nav').removeClass('header-fixed animated slideInDown');
        }
      });
    }else{
      
      $('.main-nav').addClass('fixed-menu animated slideInDown');
        
    }
  }

  fixedHeader();


  /* ----------------------------------------------------------- */
  /*  Site search
  /* ----------------------------------------------------------- */

  $('.navbar-nav .fa-search').on('click', function() {
    $("html, body").animate({ scrollTop: 0 }, "slow");
    $('.site-search .container').toggleClass('open');
  })

  $('.site-search .close').on('click', function() {
    $('.site-search .container').removeClass('open');;
  })


  /* ----------------------------------------------------------- */
  /*  Main slideshow
  /* ----------------------------------------------------------- */

  $('#main-slide').carousel({
    pause: true,
    interval: 100000,
  });


  /* ----------------------------------------------------------- */
  /*  Owl Carousel
  /* ----------------------------------------------------------- */


    //Testimonial

    $("#testimonial-carousel").owlCarousel({
 
      navigation : true, // Show next and prev buttons
      slideSpeed : 600,
      pagination:false,
      singleItem:true
 
    });

    // Custom Navigation Events
    var owl = $("#testimonial-carousel");


    // Custom Navigation Events
    $(".next").click(function(){
      owl.trigger('owl.next');
    })
    $(".prev").click(function(){
      owl.trigger('owl.prev');
    })
    $(".play").click(function(){
      owl.trigger('owl.play',1000); //owl.play event accept autoPlay speed as second parameter
    })
    $(".stop").click(function(){
      owl.trigger('owl.stop');
    })
    

    //Clients
    $("#client-carousel").owlCarousel({

      navigation : true, // Show next and prev buttons
      navigationText: ["<i class='fa fa-chevron-left'></i>", "<i class='fa fa-chevron-right'></i>"],
      slideSpeed : 800,
      pagination:false,
      items : 5,
      rewindNav: true,
      itemsDesktop : [1199,3],
      itemsDesktopSmall : [979,3],
      stopOnHover:true

    });

      //Team
      $("#team-carousel").owlCarousel({
 
        navigation : true, // Show next and prev buttons
        navigationText: ["<i class='fa fa-chevron-left'></i>", "<i class='fa fa-chevron-right'></i>"],
        slideSpeed : 800,
        pagination:false,
        items : 4,
        rewindNav: true,
        itemsDesktop : [1199,3],
        itemsDesktopSmall : [979,3],
        stopOnHover:true
 
      });

      /* ----------------------------------------------------------- */
      /*  Back to top
      /* ----------------------------------------------------------- */

       $(window).scroll(function () {
            if ($(this).scrollTop() > 50) {
                $('#back-to-top').fadeIn();
            } else {
                $('#back-to-top').fadeOut();
            }
        });
      // scroll body to 0px on click
      $('#back-to-top').click(function () {
          $('#back-to-top').tooltip('hide');
          $('body,html').animate({
              scrollTop: 0
          }, 800);
          return false;
      });
      
      $('#back-to-top').tooltip('hide');
 
  
      /* ----------------------------------------------------------- */
      /*  Skills
      /* ----------------------------------------------------------- */

          if($('.percentage').length){
          $('.percentage').easyPieChart({
            animate: 5000,
            onStep: function(value) {
            this.$el.find('span').text(~~value);
            }
            });
          }

      /* ----------------------------------------------------------- */
      /*  BX slider
      /* ----------------------------------------------------------- */

      //Blog Slider
      $('#blog-gallary').bxSlider({
        mode: 'fade',
        autoControls: false
      });

      //Portfolio item slider
      $('#portfolio-slider').bxSlider({
        mode: 'fade',
        autoControls: false
      });


      /* ----------------------------------------------------------- */
      /*  Isotope
      /* ----------------------------------------------------------- */


      // portfolio filter
      $(window).load(function(){

        var $isotope_selectors = $('#isotope-filter>a');

        if($isotope_selectors!='undefined'){
          var $portfolio = $('.isotope');
          $portfolio.isotope({
            itemSelector : '.col-sm-3',
            layoutMode : 'fitRows'
          });
          
          $isotope_selectors.on('click', function(){
            $isotope_selectors.removeClass('active');
            $(this).addClass('active');
            var selector = $(this).attr('data-filter');
            $portfolio.isotope({ filter: selector });
            return false;
          });
        }
      });


      /* ----------------------------------------------------------- */
      /*  Animation
      /* ----------------------------------------------------------- */
        //Wow
        new WOW().init();


      /* ----------------------------------------------------------- */
      /*  Prettyphoto
      /* ----------------------------------------------------------- */

      //PrettyPhoto

        $("a[data-rel^='prettyPhoto']").prettyPhoto();

});
